r pulmonale','en',1,'2015-05-26 14:30:24',NULL,NULL,'4513c058-f753-42f8-9648-40a9df07770d'),(69,2607,'1 - I only get breathless with strenuous exercise.<br>\n\n\n		2 - Short of breath hurrying on flat ground/walking up a slight hill.<br>\n\n\n		3 - Flat ground - I walk slower than people of the same age because of breathlessness, or have to stop for breath when walking at my own pace.<br>\n\n\n		4 - Stop for breath after walking 100m or after a few min flat ground.<br>\n\n	\n       	5 - I am too breathless to leave the house /breathless when dressing.<br>','en',1,'2015-05-26 14:31:48',NULL,NULL,'40ed6e74-fb3c-4240-aae1-e43b65b16ea6'),(70,2614,'<li>Location</li>\n\n	<li>Severity</li>\n\n	<li>Quality</li>\n\n	<li>Timing : Constant / Intermittent, how long did it last</li>\n\n	<li>Duration : When did it Start</li>\n\n	<li>Modifying Factors : Anything make it better or worse</li>\n\n	<li>Context : What were you doing when it started</li>\n\n	<li>Associated Signs or Symptoms</li>','en',1,'2015-05-26 14:36:57',NULL,NULL,'50729d6b-e741-4cbb-8867-2a13c00819ca'),(71,2628,'.','en',1,'2015-05-26 14:36:58',NULL,NULL,'25c6bcb5-12a5-4e04-a98e-6bc2b5ac6185'),(72,2715,'Cigarettes/day or Packs/day? Years?','en',1,'2015-05-26 14:37:02',NULL,NULL,'b3e2fa58-bb9c-4259-bb51-951abfc145ee'),(73,2717,'Drinks/day, Type of Alcohol','en',1,'2015-05-26 14:37:02',NULL,NULL,'8403b709-c72d-49d3-88cd-c1498861e8ff'),(74,2718,'CAGE Questionnaire<br>\nHave you ever felt you needed to Cut down on your drinking?<br>\nHave people Annoyed you by criticizing your drinking?<br>\nHave you ever felt Guilty about drinking?<br>\nHave you ever felt you needed a drink first thing in the morning (Eye-opener) to steady your nerves or to get rid of a hangover?','en',1,'2015-05-26 14:37:02',NULL,NULL,'93d3bc15-a276-41e1-b6be-46ca2c579ff2'),(75,2720,'General <br>\nHEENT<br>\nCV<br>\nLungs<br>\nAbdomen<br>\nMSK<br>\nSkin<br>\nNeuro <br>\nPsych<br>','en',1,'2015-05-26 14:37:02',NULL,NULL,'e75928f1-2f04-4713-b958-de0e81e