0027b662ec',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.sqlGet.pastAppointments','SELECT\n     app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\n     app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\n     DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\n     CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\n     CONCAT(pn.given_name, \' \', ifnull(pn.family_name,\'\'))                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\n     pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\nFROM\n   patient_appointment pa\n   JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\n   JOIN appointment_service app_service\n     ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\n   LEFT JOIN provider prov ON prov.provider_id = pa.provider_id AND prov.retired IS FALSE\n   LEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\n   LEFT JOIN appointment_service_type app_service_type\n     ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\n WHERE p.uuid = ${patientUuid} AND start_date_time < CURDATE() AND (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\n ORDER BY start_date_time DESC\n LIMIT 5;','Past appointments for patient','8ceef593-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.sqlGet.upComingAppointments','SELECT\n  app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\n  app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\n  DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\n  CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\n  CONCAT(pn.given_name, \' \', ifnull(pn.family_name,\'\'))                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\n  pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\nFROM\n  patient_appointment pa\n  JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\n  JOIN appointment_service app_service\n    ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\n  LEFT JOIN provider prov ON prov.provider_id = pa.provider_id AND prov.retired IS FALSE\n  LEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\n  LEFT JOIN appointment_service_type app_service_type\n    ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\nWHERE p.uuid = ${patientUuid} AND\n      start_date_time >= CURDATE() AND\n      (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\nORDER BY start_date_time ASC;','Upcoming appointments for patient','8cefcf05-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.mandatory','false','true/false whether or not the bahmnicore module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','442643d1-2beb-4eee-a055-6b43a71180c4',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.started','true','DO NOT MODIFY. true/false whether or not the bahmnicore module has been started.  This is used to make sure modules that were running  prior to a restart are started again','b2db719e-c0c6-4a65-b8ee-9cdcd5e07031',NULL,NULL,NULL,NULL,NULL,NULL),('bedmanagement.mandatory','false','true/false whether or not the bedmanagement module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','1678049f-6a44-4ff6-9cc3-b3f8cd58ebad',NULL,NULL,NULL,NULL,NULL,NULL),('bedmanagement.started','true','DO NOT MODIFY. true/false whether or not the bedmanagement module has been started.  This is used to make sure modules that were running  prior to a restart are started again','70ce745b-d7fe-43f6-8452-4f68bbaaada0',NULL,NULL,NULL,NULL,NULL,NULL),('calculation.mandatory','false','true/false whether or not the calculation module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','f88cb781-ddf3-4dc4-bbb2-4b12a389fb1b',NULL,NULL,NULL,NULL,NULL,NULL),('calculation.started','true','DO NOT MODIFY. true/false whether or not the calculation module has been started.  This is used to make sure modules that were running  prior to a restart are started again','820b3bec-7a78-4a37-922c-7598d28dc590',NULL,NULL,NULL,NULL,NULL,NULL),('concept.caseSensitiveNamesInConceptNameTable','true','Indicates whether names in the concept_name table are case sensitive or not. Setting this to false for MySQL with a case insensitive collation improves search performance.','4a8c8fdb-a26d-4a7e-b0ac-d798d16fe077',NULL,NULL,NULL,NULL,NULL,NULL),('concept.causeOfDeath','5002','Concept id of the concept defining the CAUSE OF DEATH concept','81860120-b52f-4de4-b24d-195d6f73c56c',NULL,NULL,NULL,NULL,NULL,NULL),('concept.defaultConceptMapType','NARROWER-THAN','Default concept map type which is used when no other is set','9974b56a-9110-4828-bffa-c5fa58352df7',NULL,NULL,NULL,NULL,NULL,NULL),('concept.false','2','Concept id of the concept defining the FALSE boolean concept','d3f13d8c-a3